package com.ada.model.view;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Id;import javax.persistence.Transient;@Entitypublic class ReportPartnerView {    @Id    @Column(name = "genDate")    private String genDate;    @Transient    private int partnerResDay;    @Transient    private int totalPartner;    public String getGenDate() {        return genDate;    }    public void setGenDate(String genDate) {        this.genDate = genDate;    }    public int getPartnerResDay() {        return partnerResDay;    }    public void setPartnerResDay(int partnerResDay) {        this.partnerResDay = partnerResDay;    }    public int getTotalPartner() {        return totalPartner;    }    public void setTotalPartner(int totalPartner) {        this.totalPartner = totalPartner;    }}